import React, { useEffect, useState } from 'react'
import Carousel from 'react-bootstrap/Carousel';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Button from 'react-bootstrap/Button';
import { CarouselItem} from 'react-bootstrap';
import a1 from './pages/images/img1.png';
import a2 from './pages/images/img2.png';
import a3 from './pages/images/img3.png';
import a4 from './pages/images/img4.jpg';
import a5 from './pages/images/img5.png';
import a6 from './pages/images/img6.png';



function Homepage() {
  return (
<Carousel>
      <CarouselItem>
        <img className="nature" alt="homeimages" src={a1}/>
      </CarouselItem>
      <CarouselItem>
      <img className="nature" alt="homeimages" src={a2}/>
      </CarouselItem>
      <CarouselItem>
        <img className="nature" alt="homeimages" src={a3}/>
      </CarouselItem>
      <CarouselItem>
        <img className="nature"  alt="homeimages" src={a4}/>
      </CarouselItem>
      <CarouselItem>
        <img className="nature" alt="homeimages"  src={a5}/>
      </CarouselItem>
      <CarouselItem>
        <img className="nature" alt="homeimages" src={a6}/>
      </CarouselItem>

    </Carousel>
   )}

   export default Homepage
